  false,\n\t\"url\": null,\n\t\"notes\": \"This is a graphical polygon dataset depicting
  the polygon boundaries of 107 semi-permanent census tracts and the census blocks
  within the Parish of East Baton Rouge. The census tracts and census blocks are created
  by the U. S. Census Bureau to aid in their decennial collection of census data.
  Demographic information for the population of these areas is linked to a four (4)
  digit basic number (which may or may not have a two (2) digit suffix number) assigned
  to each of the census tracts. In EBR Parish GIS data, these appear as two (2) digit
  basic numbers (which may or may not have a two (2) digit suffix number) because
  the leading zero placeholders are not shown. This dataset conveys the best currently
  (2000) available representation of the census tracts and census blocks of EBR Parish.\",\n\t\"license_title\":
